-- SHIP-420
-- DC3
-- add 'Sydney and Melbourne Next Business Day' shipping charge
-- 287 postcodes, shipping copy and country price override

BEGIN;

-- Create shipping_charge entry
    sku,
    description,
    charge,
    currency_id,
    flat_rate,
    class_id,
    channel_id,
    is_enabled,
    is_express,
    is_slow
)
values (
    '9000330-001',
    'Sydney and Melbourne Next Business Day',
    13.64, -- exc. VAT
    (select id from currency where currency = 'AUD'),
    True, -- is flat_rate
    (select id from shipping_charge_class where class = 'Air'),
    (select id from channel where web_name ilike 'NAP%'),
    False, -- is_enabled (it's not - will be enabled after copy/translations)
    True, -- is_express (it is)
    False -- is_slow (it's not)
);

-- Add country charge override
    shipping_charge_id,
    country_id,
    currency_id,
    charge
)
values(
    (select id from shipping_charge where sku = '9000330-001'),
    (select id from country where code = 'AU'),
    (select id from currency where currency = 'AUD'),
    15.00 -- inc VAT. Yes, that's how it works.
);

-- Add shipping copy
    'Next Business Day', -- name
    'Next Business Day', -- public_name
    'Next Business Day', -- title
    'Next Business Day', -- public_title
    'Order by 1.30pm, Mon-Fri',
    '&bull;  Delivery between 9am-5pm, Monday to Friday <br />&bull;  Orders placed before 1.30pm Monday to Friday will be delivered next business day <br  />&bull; Orders placed after 1.30pm on Friday will be delivered on Tuesday',
    'Delivery: next business day, 9am-5pm, Mon-Fri',
    'You will receive an email confirming the dispatch of your order and your Air Waybill number.',
    (select id from shipping_charge where sku = '9000330-001')  -- Shipping charge id
);

-- This shipping option is only available to these postcodes...
-- (287 of them, FYI)

COMMIT;
